import React from 'react';
import BackgroundImage from "./BackgroundImage";
import Form from "./Form";

const Home = () => {
  return (
    <>
    <div className="App">
    <BackgroundImage/>
    <Form/>
    </div>
    </>
  )
}

export default Home;
